ест для приема на обучение по различным условиям поступления',NULL,2,NULL,'files',NULL,62,NULL,'2020-07-01 20:55:49','2020-07-01 20:55:49',NULL),(576,'Контрольные цифры приёма','vjur5YQat8mZeDPwj6cq6QaAOEHNEgi1AeN0sVLW.pdf',1,'Контрольные цифры приёма (2020).pdf','file','n0zcenuzkeb8i3ipadirt9',NULL,575,'2020-07-01 20:55:49','2020-08-03 10:34:29','pdf'),(577,'План целевого приёма в ординатуру в 2020 году','IyFZV4ZraCmK0dnTmbVP7KPrvUodecWxToAHklos.pdf',2,'План целевого приёма в ординатуру (2020).pdf','file','vxaz8skqyhmtokuii85q2',NULL,575,'2020-07-01 20:59:25','2020-08-03 10:34:27','pdf'),(578,' Детализация целевого приёма','8joAt9ETa20P5nFfPkFvxvX9yW6dBgbpzLPpdgyw.pdf',3,'Детализация целевого приёма.pdf','file','b6n9rk0vmo79pv9dcye1q8',NULL,575,'2020-07-01 20:59:25','2020-08-03 10:34:23','pdf'),(579,'План приёма в ординатуру на платной основе','d36tmbLTylQoYuCCie6Ks8Dxs40f4GAKqcx4xIkb.pdf',4,'Документ.pdf','file','uwviopuox3mrc7kke529nl',NULL,575,'2020-07-01 20:59:25','2020-08-03 10:34:21','pdf'),(581,'Изменения в Правила приёма в ординатуру (2020)','P9f0P8Xole3KRsKvsrAw0Ip8g0YGqciutTQyuyaF.pdf',1,'Изменения в Правила приёма в ординатуру (2020).pdf','file','zi5w5joadwb406h6xqgim',NULL,520,'2020-07-03 20:06:17','2020-07-03 20:06:17','pdf'),(580,'Приказ об установлении количества мест для приёма в ординатуру в 2020 году иностранных граждан и лиц без гражданства','SppyaIrB4GkvNg1YEy9tBolfy7cSesWLtlEP1qtr.pdf',5,'Приказ об установлении количества мест для приёма в ординатуру в 2020 году иностранных граждан и лиц без гражданства.pdf','file','8brr2ilj44nvesq6hg1p7f',NULL,575,'2020-07-01 21:01:05','2020-08-03 10:34:19','pdf'),(551,'Изменения в Правила приема на обучение по программам подготовки научно-педагогических кадров в аспирантуре','FJuh6dBc9l66iN7DHTFBqi49njtrapVsHYxpudV4.pdf',1,'Изменения в правила приема 2020.PDF','file','zmgqrhho96semuxz01tei8',NULL,46,'2020-06-25 08:31:46','2020-06-25 08:33:00','PDF'),(567,'Памятка абитуриента','OxYACT2yW7eIfVxDyYxbPhNhxZsqKFJEN2oHW60T.pdf',0,'Памятка-бакалавры и специалисты-2020.pdf','file','w1nwbnwp7z0unf2h9sh9a',NULL,566,'2020-06-30 12:26:17','2020-06-30 12:26:17','pdf'),(568,NULL,NULL,1,NULL,'text',NULL,77,NULL,'2020-06-30 12:26:17','2020-06-30 12:26:17',NULL),(569,NULL,NULL,0,NULL,'files',NULL,78,NULL,'2020-06-30 12:27:58','2020-06-30 12:27:58',NULL),(570,'Памятка поступающего','rKUOx7eIbuMbOWEr4AMMXgYJ1BHSFyI7IvaZn020.pdf',0,'Памятка-магистры-2020.pdf','file','57w8mtss37eo5jdhwtvv0o',NULL,569,'2020-06-30 12:27:58','2020-06-30 12:27:58','pdf'),(582,'Электронная форма подачи документов',NULL,0,'<p>	С 6 июля 2020 года на сайте университета можно осуществить <strong>электронную подачу документов</strong> для поступления на обучение в аспирантуру: <a href=\"https://p.mrsu.ru/Account/Register\" rel=\"noopener noreferrer\" target=\"_blank\">https://p.mrsu.ru/Account/Register</a></p><p>	Поступающий в университет вправе направить заявление на поступление в электронной форме, заполнив форму установленного образца на сайте. После заполнения формы необходимо прикрепить документы, необходимые при подаче (см. выше Порядок приема документов от поступающих). После загрузки и отправки документов на указанный абитуриентом электронный адрес будет выслано письмо для подтверждения. В течение одного рабочего дня сотрудники приемной комиссии проверяют комплект документов на правильность заполнения, наличие всех необходимых документов, согласно Правил приема в ФГБОУ ВО «МГУ им. Н.П. Огарёва» и либо включают абитуриента в списки подавших документы, либо информируют по электронной почте о невозможности включения.</p>','text',NULL,56,NULL,'2020-07-05 18:26:14','2020-07-14 11:07:27',NULL),(618,'Регламент вступительных испытаний с применением дистанционных технологий в 2020 году',NULL,1,NULL,'files',NULL,67,NULL,'2020-07-13 10:23:27','2020-07-16 07:14:28',NULL),(619,'Регламент вступительных испытаний с применением дистанционных технологий в 2020 году','RFkLUEiyQL6R79juMMwJZmLkyCSk24KRQxaK5AWP.pdf',0,'Регламент вступительных испытаний с применением дистанционных технологий в 2020 году.pdf','file','m1afy0uu0aodkiw95upib',NULL,618,'2020-07-13 10:23:27','2020-07-13 10:23:27','pdf'),(617,'Регламент вступительных испытаний с применением дистанционных технологий в 2020 году','yLhNLrYU9mrrnzUvgREBCgOh70vnMuxPWQGeBI2Y.pdf',0,'Регламент вступительных испытаний с применением дистанционных технологий в 2020 году.pdf','file','33s7yjxwspp4w4zodiqacb',NULL,616,'2020-07-13 10:14:36','2020-07-13 10:14:36','pdf'),(594,NULL,NULL,0,'<p>1) Для подтверждения стажа работы необходимо приложить заверенную копию трудовой книжки и справку с места работы с указанием ставки.</p><p><br></p><p>2) Не оформлен список опубликованных научных работ (Приложение 1 Изменений в Правила приёма).</p><p><br></p><p>3) Не приложена копия страхового свидетельства обязательного пенсионного страхования (п 3.7 Правил приёма).</p><p><br></p><p>4) Указаны 3 специальности.</p><p><br></p><p>В соответствии с п 3.1 Правил приёма, поступающий вправе подать заявление (заявления) о приеме одновременно не более чем в 3 организации. В каждой из указанных организаций поступающий вправе участвовать в конкурсе <strong>не более чем по 2 специальностям</strong>.</p><p><br></p><p>5) В заявлении не указаны индивидуальные достижения, хотя они есть. Чаще всего забывают про средний балл по диплому. Если ваш средний балл от 4.0 при отсутствии диплома с отличием, указывайте это в заявлении.</p><p><br></p><p>6) Заявления на целевое обучение могут быть приняты только при наличии договора о целевом обучении.</p><p><br></p><p>7) В \"бумажном\" заявлении есть пункт \"В качестве результатов тестирования прошу учитывать:\".</p><p><br></p><p>Если вы получили диплом специалиста в 2020 году или до 2019 года, здесь отметки ставить не нужно. Вступительное испытание (тестирование) будет организовываться приёмной комиссией, и проводиться дистанционно после приёма заявления.</p><p><br></p><p>Если вы закончили специалитет в 2019 году и проходили тестирование в рамках процедуры аккредитации, чтобы учитывать его результаты, и не проходить вступительное тестирование в этом году, в заявлении нужно в пункте \"б\" поставить отметку и подпись.</p>','text',NULL,79,NULL,'2020-07-08 12:24:53','2020-07-15 07:56:46',NULL),(595,NULL,NULL,0,'<h5>Платная основа</h5><p><br></p><h6>Акушерство и гинекология</h6><ol><li>Шишканова Татьяна Ивановна</li></ol><p><br></p><h6>Рентгенология</h6><ol><li>Айзятова Юлия Олеговна</li></ol><p><br></p><h6>Ультразвуковая диагностика</h6><ol><li>Кочеткова Олеся Дмитриевна</li></ol><p><br></p><h6>Дерматовенерология</h6><ol><li>Кузьмина Анастасия Сергеевна</li><li>Тарабаев Владислав Александрович</li><li>Горошкова Елизавета Алексеевна</li><li>Кочеткова Олеся Дмитриевна</li></ol><p><br></p><h6>Кардиология</h6><ol><li>Бочкарева Ольга Николаевна</li><li>Матрёночкина Елена Валерьевна</li><li>Кошкина Алёна Витальевна</li></ol><h3><br></h3><h6>Неврология</h6><ol><li>Бочкарева Ольга Николаевна</li></ol><h3><br></h3><h6>Терапия</h6><ol><li>Матрёночкина Елена Валерьевна</li><li>Шишканова Татьяна Ивановна</li><li>Кошкина Алёна Витальевна</li><li>Николаева Татьяна Юрьевна</li><li>Косынкина Дарья Дмитриевна</li></ol><p><br></p><h6>Офтальмология</h6><ol><li>Кузьмина Анастасия Сергеевна</li></ol><h3><br></h3><h6>Стоматология общей практики</h6><ol><li>Сигуева Олеся Александровна</li><li>Спирина Яна Александровна</li><li>Сеитова Альбина Петровна</li></ol><h3><br></h3><h6>Стоматология терапевтическая</h6><ol><li> Сигуева Олеся Александровна</li><li> Федорова Алёна Александровна</li><li>Чернова Анна Александровна</li></ol><h3><br></h3><h6>Стоматология хирургическая</h6><ol><li>Лямзин Сергей Сергеевич</li><li>Кокарева Нина Алексеевна</li><li>Сеитова Альбина Петровна</li></ol><h3><br></h3><h6>Стоматология ортопедическая</h6><ol><li>Королев Дмитрий Владимирович</li><li>Спирина Яна Александровна</li><li>Кокарева Нина Алексеевна</li><li>Карпушкин Александр Иванович</li><li>Чернова Анна Александровна</li></ol><p><br></p><p><br></p><h5>Бюджетная основа</h5><p><br></p><h6>Акушерство и гинекология</h6><ol><li>Титойкина Юлия Васильевна</li><li>Шишканова Татьяна Ивановна</li></ol><p><br></p><h6>Педиатрия</h6><ol><li>Кудашкина Екатерина Владимировна</li></ol><p><br></p><h6>Кардиология</h6><ol><li>Кошкина Алёна Витальевна</li></ol><p><br></p><h6>Терапия</h6><ol><li>Никульшина Татьяна Юрьевна</li><li>Курганкина Юлия Витальевна</li><li>Шишканова Татьяна Ивановна</li><li>Кошкина Алёна Витальевна</li><li>Горошкова Елизавета Алексеевна</li><li>Николаева Татьяна Юрьевна</li><li>Косынкина Дарья Дмитриевна</li></ol><h3><br></h3><h6>Общая врачебная практика</h6><ol><li>Никульшина Татьяна Юрьевна</li></ol><h3><br></h3><h6>Онкология</h6><ol><li>Курганкина Юлия Витальевна</li></ol><h6><br></h6><h6>Оториноларингология</h6><ol><li>Кудашкина Екатерина Владимировна</li></ol><p><br></p><h6>Хирургия</h6><ol><li>Николаева Татьяна Юрьевна</li></ol>','text',NULL,80,NULL,'2020-07-08 13:55:21','2020-07-09 13:59:39',NULL),(603,'Особенности проведения приёма иностранных граждан и лиц без гражданства',NULL,0,'<p>	<strong>1.</strong> Иностранные граждане и лица без гражданства имеют право на получение высшего образования за счет бюджетных ассигнований в соответствии с международными договорами Российской Федерации, федеральными законами или установленной Правительством Российской Федерации квотой на образование иностранных граждан и лиц без гражданства (далее – квота на образование иностранных граждан), а также за счет средств физических лиц и юридических лиц в соответствии с договорами об оказании платных образовательных услуг.</p><p>	</p><p>	<strong>2.</strong> Прием на обучение в пределах квоты на образование иностранных граждан осуществляется в соответствии с направлениями федерального органа исполнительной власти, осуществляющего функции по выработке государственной политики и нормативно-правовому регулированию в сфере образования. Зачисление на обучение в пределах квоты на образование иностранных граждан осуществляется отдельным приказом (приказами) по университету.</p><p><br></p><p>	<strong>3.</strong> Иностранные граждане и лица без гражданства, являющиеся соотечественниками, проживающими за рубежом, имеют право на получение высшего образования наравне с гражданами Российской Федерации при условии соблюдения ими требований, предусмотренных статьей 17 Федерального закона от 24 мая 1999 г. № 99-ФЗ «О государственной политике Российской Федерации в отношении соотечественников за рубежом» (далее – Федеральный закон № 99-ФЗ).</p><p><br></p><p>	<strong>4.</strong> На соотечественников, проживающих за рубежом и не являющихся гражданами Российской Федерации, не распространяются особые права при приеме на обучение по программам бакалавриата и программам специалитета, предоставляемые в соответствии с Федеральным законом № 273-ФЗ, если иное не предусмотрено международным договором Российской Федерации.</p><p><br></p><p>	<strong>5.</strong> При приеме иностранных граждан и лиц без гражданства на обучение по программам бакалавриата и программам специалитета на места по договорам об оказании платных образовательных услуг (платное обучение) вступительные испытания проводятся в соответствии с <a href=\"https://abiturs.mrsu.ru/Inostrannim-abiturientam-Priyom-po-dogovoru\" rel=\"noopener noreferrer\" target=\"_blank\">Перечнем вступительных испытаний для иностранных граждан, поступающих по договорам на оказание платных образовательных услуг</a>. В связи с этим для иностранных граждан и лиц без гражданства выделяется отдельное количество мест для приема и проводится отдельный конкурс на эти места. </p><p>	</p><p>	<strong>6.</strong> Прием документов осуществляется в следующие сроки:</p><p>	1) у иностранных граждан и лиц без гражданства, указанных в пункте 5, в сроки, установленные пунктом 18  <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил</a>; </p><p>	2) прием документов у иностранных граждан и лиц без гражданства,поступающих для обучения по договорам с оплатой стоимости обучения физическими и (или) юридическими лицами, осуществляется в сроки с 20 июня по 17 октября 2020 года.</p><p><br></p><p>	<strong>7.</strong> При подаче документов для поступления на обучение иностранный гражданин или лицо без гражданства указывает в заявлении о приеме реквизиты документа, удостоверяющего личность, либо документа,удостоверяющего личность иностранного гражданина в Российской Федерации или личность лица без гражданства в Российской Федерации в соответствии со статьей 10 Федерального закона от 25 июля 2002 г. № 115-ФЗ «О правовом положении иностранных граждан в Российской Федерации» (далее –документ, удостоверяющий личность иностранного гражданина), и представляет в соответствии с подпунктом 1 пункта 68 <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил</a> оригинал или копию документа, удостоверяющего личность, гражданство, либо документа, удостоверяющего личность иностранного гражданина. </p><p><br></p><p>	<strong>8.</strong> При поступлении на обучение в соответствии со статьей 17 Федерального закона № 99-ФЗ соотечественник представляет помимо документов, указанных в пункте 68 <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил</a>, оригиналы или копии документов, предусмотренных статьей 17 Федерального закона № 99-ФЗ. Иностранные граждане, которые поступают на обучение на основании международных договоров, представляют помимо документов, указанных в пункте 68 <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил </a>, документы, подтверждающие их отнесение к числу лиц, указанных в соответствующих международных договорах.</p><p><br></p><p><strong>9.</strong> Зачисление иностранных граждан и лиц без гражданства, указанных в пункте 133 настоящих <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил</a>, на места, финансируемые за счет бюджетных ассигнований, проводится в сроки, установленные в пунктах 118-123 <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил</a>.</p><p><br></p><p><strong>10.</strong> Зачисление иностранных граждан и лиц без гражданства для обучения на места по договорам об оказании платных образовательных услуг (платное обучение) осуществляются в срок по 24 октября 2020 года.</p><p><br></p><p><strong>11.</strong> Прием иностранных граждан и лиц без гражданства на обучение по образовательным программам, содержащим сведения, составляющие государственную тайну, осуществляется только в пределах квоты на образование иностранных граждан с соблюдением требований, предусмотренных законодательством Российской Федерации о государственной тайне.</p>','text',NULL,82,NULL,'2020-07-09 07:15:06','2020-07-28 05:08:54',NULL),(604,NULL,NULL,0,NULL,'files',NULL,72,NULL,'2020-07-09 07:31:55','2020-07-09 07:31:55',NULL),(605,'Перечень вступительных испытаний для иностранных граждан, поступающех по договорам об оказании платных образовательных услуг','3fmc6Q5OogZ6gTjS6cuxnqk2pSCIYGA9djRUrAkW.pdf',0,'Приложение 6.pdf','file','537jessu6ju7jz6dqw0kk',NULL,604,'2020-07-09 07:31:55','2020-07-09 07:31:55','pdf'),(614,'Стоимость обучения на 1 курсе по программам бакалавриата, специалитета, магистратуры в 2020/2021 учебном году','UeGt49YUa5Etg5LYVsOK3ZsKRDQVGNKljFfXA3EZ.pdf',1,'Выписка ВО иностранные граждане.PDF','file','5zk04erhyzj8ulyjtoxtom',NULL,604,'2020-07-13 06:28:04','2020-07-13 06:28:04','PDF'),(606,NULL,NULL,0,'<p>	На подготовительном отделении для иностранных граждан проходят обучение слушатели из разных стран по дополнительной общеобразовательной программе, обеспечивающей подготовку иностранных граждан и лиц без гражданства к освоению профессиональных образовательных программ на русском языке</p><p>&nbsp;</p><p>	<strong>Профили программы обучения:</strong></p><ul><li>естественнонаучный&nbsp;(русский язык, математика, физика и химия);</li><li>инженерно-технический и технологический&nbsp;(русский язык, математика, физика и информатика);</li><li>гуманитарный&nbsp;(русский язык, обществознание, история и литература);</li><li>экономический&nbsp;(русский язык, обществознание, история и математика);</li><li>медико-биологической направленности&nbsp;(русский язык, химии, биология и физика).</li></ul><p><br></p><p>	<strong>Учебный процесс</strong></p><p>	Слушатели подготовительного отделения изучают русский язык, а также общеобразовательные предметы для продолжения обучения. Большую часть подготовительной программы составляет курс&nbsp;русского языка. </p><p>Занятия на подготовительном отделении дают уникальную возможность иностранным слушателям заложить твердую основу знаний грамматики русского языка и приобрести навыки устной и письменной речи, а также привести в систему знания по общеобразовательным дисциплинам по профилю дополнительной общеобразовательной программы. </p><p>Учебная программа начинается с&nbsp;письменного и устного тестирования&nbsp;для определения уровня владения русским языком и подбора соответствующей группы по&nbsp;пятиуровневой системы обучения&nbsp;– от начального до продвинутого. Все программы по русскому языку на подготовительном отделении построены по&nbsp;интенсивной системе обучения. </p><p><br></p><p>	<strong>Внеучебная деятельность</strong> является неотъемлемой частью образовательного процесса и направлена, в первую очередь, на приобщение к культуре страны пребывания. Слушатели подготовительного отделения активно принимают участие в конкурсах, олимпиадах, культурных, спортивных и других мероприятиях, проводимых в университете.&nbsp;</p><p><br></p><p>	<strong>Свидетельство</strong></p><p>	После окончания обучения и успешной сдачи экзаменов на подготовительном отделении иностранные граждане получают сертификат (свидетельство) о прохождении курса обучения по программе.</p><p>  </p><p><br></p><p>Будем рады видеть Вас в стенах нашего подготовительного отделения!</p><p> </p>','text',NULL,73,NULL,'2020-07-09 07:58:13','2020-07-14 11:16:37',NULL),(607,NULL,NULL,0,'<p>	Иностранные граждане и лица без гражданства имеют право на получение высшего образования за счет бюджетных ассигнований наравне с гражданами Российской Федерации в соответствии с международными договорами Российской Федерации, а также иностранные граждане и лица без гражданства, являющиеся соотечественниками, проживающими за рубежом, имеют право на получение высшего образования наравне с гражданами Российской Федерации при условии соблюдения ими требований, предусмотренных статьей 17 Федерального закона от 24 мая 1999 г. № 99-ФЗ «О государственной политике Российской Федерации в отношении соотечественников за рубежом» (далее – Федеральный закон № 99-ФЗ).</p><p><br></p><p>	Чтобы подтвердить статус соотечественника, при подаче заявления на прохождение вступительных испытаний необходимо предоставить документы, подтверждающие, что Ваши родственники по восходящей линии были гражданами СССР:</p><ul><li>Ваш паспорт и свидетельство о рождении с переводом на русский язык, </li><li>паспорт и свидетельство о рождении с переводом на русский язык одного из родственников, рожденных в СССР. Если у родителя была осуществлена смена фамилии – необходим также документ, подтверждающий это (например, свидетельство о вступлении в брак) с переводом на русский язык.</li></ul>','text',NULL,71,NULL,'2020-07-09 08:02:03','2020-07-14 11:15:48',NULL),(615,'Стоимость обучения на 1 курсе ординатуры в 2020/2021 учебном году','m2kPcs2Ma1OW9Y0hHtvXRmmlbzPuW0GuT5asMqL2.pdf',2,'Стоимость ординатура иностранный граждане.PDF','file','e6kb48kxphu7u2xsavbvyf',NULL,604,'2020-07-13 06:28:36','2020-07-13 06:28:36','PDF'),(620,'Регламент проведения вступительных испытаний с применением дистанционных технологий','CcSsIVlA8xrYpfjdMyDtvsIFJdZn0Fu3pGJekUCd.pdf',10,'Регламент проведения вступительных испытаний с применением дистанционных технологий.pdf','file','1hvuckjnsf39vzfvktymsq',NULL,46,'2020-07-13 11:04:12','2020-07-13 11:42:26','pdf'),(621,'',NULL,0,NULL,'files',NULL,83,NULL,'2020-07-14 12:21:49','2020-07-14 13:20:46',NULL),(622,'Расписание вступительных испытаний на программы бакалавриата и специалитета (очная и очно-заочная форма, бюджет)','d4JDEcGsY28OywoNVvEPYBtvGK8xae7rpaVa6X2f.pdf',0,'Расписание вступительных испытаний на программы бакалавриата и специалитета   ОФО, ОЗФО, бюджетная основа.pdf','file','ebf3xknmvlhie5m8x1n1c',NULL,621,'2020-07-14 12:21:49','2020-07-14 13:20:46','pdf'),(623,'',NULL,1,NULL,'files',NULL,83,NULL,'2020-07-14 12:22:44','2020-07-14 13:20:46',NULL),(624,'Расписание вступительных испытаний на программы бакалавриата и специалитета (заочная форма, бюджет)','H2Mjbx1F1sjEm3JAuWjgb0viKSmqsYILGG73CEdO.pdf',0,'Расписание вступительных испытаний на программы бакалвриата и специалитета заочная форма обучения, бюджетная основа.pdf','file','h7yw1n9kbg69ked0kkmaw',NULL,623,'2020-07-14 12:22:44','2020-07-15 11:14:19','pdf'),(625,'',NULL,2,NULL,'files',NULL,83,NULL,'2020-07-14 12:23:44','2020-07-14 13:20:46',NULL),(626,'Расписание вступительных испытаний на программы бакалавриата и специалитета (очная, очно-заочная форма, платная основа)','g6jJs3HKPmUnv8dVmAy5k7nH9g93uLESQvINo0nC.pdf',0,'Расписание вступительных испытаний на программы бакалвриата и специалитета ОФО, ОЗФО, платная основа.pdf','file','701bjspmzbpxbxgklotam',NULL,625,'2020-07-14 12:23:44','2020-07-15 11:14:19','pdf'),(627,'',NULL,3,NULL,'files',NULL,83,NULL,'2020-07-14 12:24:13','2020-07-14 13:20:46',NULL),(628,'Расписание вступительных испытаний на программы бакалавриата и специалитета (заочная форма, платная основа)','n8wSlOHju4io6D8r5D8KEuoRSbhOqV6clkpt3miS.pdf',0,'Бакалавриат ЗФО платно.pdf','file','iwpnrpbzcubl8lydw7fc9',NULL,627,'2020-07-14 12:24:13','2020-07-14 13:20:46','pdf'),